import React from "react";
import "../../assets/css/neardetail.css";
import axios from "axios";
import Goback from "../smallpages/Goback";
class pro_detail extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            neardetailData: null,
        };
    }
    componentDidMount() {
        axios.get("/neardetail").then((res) => {
            console.log(res);
            this.setState({
                neardetailData: res.data.data
            })
        })
    }
    render() {
        return (
            <div className="pro_detail">
                <Goback title={this.state.neardetailData != null ? this.state.neardetailData.poi_info.name : "商家"}></Goback>
                <div className="header_img">
                    <img src="" alt="" />
                </div>
            </div>
        );
    }
}

export default pro_detail;
